const ExpenseItem = (props) => {


  return (
    <Card className='expense-item'>
        <ExpenseDate date = {props.date}/>
        <div className='expense-item__description'></div>
        <h2>{title}</h2>
      <div className='expense-item__price'>${props.amount}
      </div>
    </Card>
  );
}

export default ExpenseItem;
